import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React from "react";
import "./App.css";
import Navbar from "./components/navbar";
import Home from "./components/routes/home.js";

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" exact component=<Home /> />
        </Routes>
      </Router>
    </>
  );
}

export default App;
